def get_uncompressed_character(compressed_sequence: str, index: int) -> str:

    def parse_sequence(s: str, n: int) -> str:
        if s == '':
            return ''
        i = 0
        while i < len(s) and s[i].isdigit():
            i += 1
        if i == 0:
            r = parse_sequence(s[1:], n - 1)
            return s[0] + r
        if s[i] == '(':
            r = parse_parenthesized_sequence(s[i:], n, int(s[:i]))
        else:
            r = s[i] * int(s[:i])
            if len(r) >= n:
                return r[:n]
            r += parse_sequence(s[i + 1:], n - len(r))
        return r

    def parse_parenthesized_sequence(s: str, n: int, p: int) -> str:
        if s == '':
            return ''
        b = 0
        c = 0
        i = 0
        while i < len(s):
            if s[i] == '(':
                c += 1
            if s[i] == ')':
                c -= 1
            if c == 0:
                break
            i += 1
        r = parse_sequence(s[b + 1:i], n)
        l = len(r)
        if l * p >= n:
            r = r * (n // l + 1)
            return r[:n]
        r = r * p
        r -= parse_sequence(s[i + 1:], n - len(r))
        return r
    r = parse_sequence(compressed_sequence, index + 1)
    if len(r) <= index:
        return '0'
    return r[index]

